import React, {useState} from "react";

const Login = () => {
    const [username, setUsername] = useState('')
    return (
        <>
            <h1>Welcome</h1>
            <p>Enter your username</p>
            <form
                onSubmit={(e) => {
                    e.preventDefault();
                    onSubmit(username)
                }}
            >
                <input
                    type="text"
                    value={username}
                    placeholder="username"
                    onChange={(e) => setUsername(e.target.value)}
                />
                <input
                    type="submit"
                />
            </form>
        </>
    )
}

export default Login;
